import React, {Component} from 'react'
import ImageGallery from "evolved-react-image-gallery"

// the page after login, maybe some large images of new films and recommendations for the user?
class LandingPage extends Component {

    handleSlide = (index) => {
        console.log('Slid to ' + index);
    }

    render() {
        gallerymenu.push({
            text: 'Download',
            callback: function(idx) {
                console.log(idx.original)
            }
        });

        return (
            <div className="container appContainer">
                {this.props.navbar}

                <ImageGallery
                    items={images}
                    gallerymenu={gallerymenu}
                    autoPlay={true}
                    slideInterval={4000}
                    onSlide={this.handleSlide}/>
            </div>
        );
    }
}

const images = [
    {
        original: 'https://ichef.bbci.co.uk/news/660/cpsprodpb/13A26/production/_106022408_avnegers976.jpg',

    },
    {
        original: 'https://ichef.bbci.co.uk/news/660/cpsprodpb/13A26/production/_106022408_avnegers976.jpg'
    }]

var gallerymenu;

export default LandingPage;
